      SELECT ALL * FROM tab1 (FORMAT parquet) cor0 WHERE NOT col0 * - + 72 IN ( - col1 * col0 * col0, col1 + + col1 * - 33 * - ( - ( + + col0 ) ) + + col2, - + col2 );
  - name: tab1

outputs:
  - name: q5833.out
    data: |
      51	14	96
      85	5	59
      91	47	68
